import React, { useState, useEffect } from "react";
import axios from "axios";
import{Link, useParams} from "react-router-dom";
import img1 from '../imgs/aitu.png'

export default function MainPage() {

  const[projects, setProjects]=useState([])
  useEffect(()=>{
    loadProject();
  }, [])

  const{id}=useParams()

  const loadProject=async ()=>{
    const result=await axios.get("http://localhost:8080/api/test/project/")
    setProjects(result.data);
  }

  return (
      <div className="container-xxl">
        <div className="jumbotron">
          <h3>Темы для дипломных работ от Предприятий</h3>
        </div>

        <div id="carouselExampleControls" className="carousel slide" data-bs-ride="carousel">
          <div className="carousel-inner">
            <div className="carousel-item active">
              <img src={img1} className="d-block w-100" alt="..."/>
            </div>
            <div className="carousel-item">
              <img src={img1} className="d-block w-100" alt="..."/>
            </div>
            <div className="carousel-item">
              <img src={img1} className="d-block w-100" alt="..."/>
            </div>
          </div>
          <button className="carousel-control-prev" type="button" data-bs-target="#carouselExampleControls"
                  data-bs-slide="prev">
            <span className="carousel-control-prev-icon" aria-hidden="true">asd</span>
            <span className="visually-hidden">Previous</span>
          </button>
          <button className="carousel-control-next" type="button" data-bs-target="#carouselExampleControls"
                  data-bs-slide="next">
            <span className="carousel-control-next-icon" aria-hidden="true">asd</span>
            <span className="visually-hidden">Next</span>
          </button>
        </div>
      </div>
  )
  }
